import axios from 'axios';

export default (urlFeed) => {
    //TODO check if we need headers later
    const api = axios.create({
        baseURL: urlFeed,
        method: 'get', 
        headers: {
            'Access-Control-Allow-Origin' : 'http://localhost:19006',
             
        }
    });

    return api;
};

